create table monsters_spawns_dungeons_waves
(
    Id                int auto_increment
        primary key,
    DungeonSpawnId    int          null,
    MonsterGradeId    int          null,
    MinPlayerLevel    int          null,
    WaveNumber        int          null,
    MonsterGradeIdBak varchar(255) null,
    MonsterId         int          null,
    MonsterName       varchar(255) null
)
    engine = MyISAM
    charset = utf8;

create index DungeonSpawnId
    on monsters_spawns_dungeons_waves (DungeonSpawnId);

